import Foundation
import CoreLocation
import SwiftCSV
import TelemetryClient

struct LibraryListItemModel: Decodable {
    let name: String
    let address: String
    let accessibility: String
}

struct PlaygroundListItemModel: Decodable {
    let lat: CLLocationDegrees
    let lng: CLLocationDegrees
    let name: String
    let address: String?
    let url: String
}

struct BathroomListItemModel: Decodable {
    let lat: CLLocationDegrees
    let lng: CLLocationDegrees
    let name: String
    let address: String
    let accessibility: String?
    let id: String
    let url: String?
}

struct Constants {
    static func getBathrooms() -> [Bathroom] {
    let decoder = JSONDecoder()
    
    guard let playgroundData = Constants.playgroundList.data(using: .utf8), let libraryData = Constants.libraryList.data(using: .utf8), let targetData = Constants.targetStoreList.data(using: .utf8) else {
        print("Error: Cannot convert string to Data")
        TelemetryManager.send("Error", with: ["type": "BathroomData", "message": "Cannot convert string to Data"])
        return []
    }
    
    do {
        let libraryItems = try decoder.decode([BathroomListItemModel].self, from: libraryData)
        let playgroundItems = try decoder.decode([BathroomListItemModel].self, from: playgroundData)
        let targetStoreItems = try decoder.decode([BathroomListItemModel].self, from: targetData)

        let playgroundBathrooms: [Bathroom] = playgroundItems.compactMap { item in
            let coordinate = CLLocationCoordinate2D(latitude: item.lat, longitude: item.lng)
            let category: Category = item.name.contains("Playground") ? .playground : .park
            return Bathroom(name: item.name, accessibility: Accessibility(rawValue: item.accessibility ?? "unknown") ?? .unknown, coordinate: coordinate, address: item.address, id: item.id, url: item.url, category: category)
        }
        let libraryBathrooms: [Bathroom] = libraryItems.compactMap { item in
            let coordinate = CLLocationCoordinate2D(latitude: item.lat, longitude: item.lng)
            
            return Bathroom(name: item.name, accessibility: Accessibility(rawValue: item.accessibility ?? "unknown") ?? .unknown, coordinate: coordinate, address: item.address, id: item.id, url: item.url, category: .library)
        }
        let targetStoreBathrooms: [Bathroom] = targetStoreItems.compactMap { item in
            let coordinate = CLLocationCoordinate2D(latitude: item.lat, longitude: item.lng)
            
            return Bathroom(name: item.name, accessibility: Accessibility(rawValue: item.accessibility ?? "unknown") ?? .unknown, coordinate: coordinate, address: item.address, id: item.id, url: item.url, category: .store)
        }
        
        for bathroom in playgroundBathrooms {
            print(bathroom.description)
        }
         
        let fullList = Array(Set((libraryBathrooms + playgroundBathrooms + targetStoreBathrooms)))
        print(fullList.count)
        return fullList
    } catch {
        print(error)
        TelemetryManager.send("Error", with: ["type": "BathroomData", "message": error.localizedDescription])
    }
    
    
    return []
}
    
